const Table = ({ data }) => {
    const tableStyle = {
        width: '80%',           // Adjust width as needed
        margin: '0 auto',       // Center horizontally
        borderCollapse: 'collapse', // Optional: Collapse borders
    };

    const containerStyle = {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',        // Optional: Full viewport height
    };

    return (
        <div style={containerStyle}>
            <table style={tableStyle}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Age</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((row, index) => (
                        <tr key={index}>
                            <td>{"name"}</td>
                            <td>{"age"}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Table;
